import React from "react";
import { MDBCarousel,MDBMask,MDBCarouselCaption, MDBCarouselInner, MDBCarouselItem, MDBView, MDBContainer } from
"mdbreact";
import { connect } from "react-redux";
import {fetchProduct} from '../actions/index';
class CarouselPage extends Component {
    state = {}
    componentWillMount() {
        this.props.fetchProduct();
    }
    render() { 
        return ( 
             <MDBContainer>
      <MDBCarousel
        activeItem={1}
        length={3}
        showControls={true}
        showIndicators={false}
        className="z-depth-1"
        slide
      >
        <MDBCarouselInner>
          <MDBCarouselItem itemId="1">
            <MDBView>
              <img
                className="d-block w-100"
                src="https://mdbootstrap.com/img/Photos/Slides/img%20(35).jpg"
                alt="First slide"
                          />
                          
          <MDBMask overlay="black-light" />
             </MDBView>
            <MDBCarouselCaption>
            <h3 className="h3-responsive">Light mask</h3>
            <p>First text</p>
          </MDBCarouselCaption>
          </MDBCarouselItem>
    
        </MDBCarouselInner>
      </MDBCarousel>
    </MDBContainer>
         );
    }
}
 


export default connect(mapStateToProps,{fetchProduct})(CarouselPage);
